        })
        .catch(error => {
          console.log(error)
          res.status(422)
        })
    })
  app.route('/deletar_sala/:id')
    .delete(verifyToken, (req, res) => {
      roomsController.delete(req.params)
        .then(rs => {
          res.json(rs)
          res.status(204)
        })
        .catch(error => {
          console.log(error)
          res.status(422)
        })
    })
}

